create table units
(
    idgps         int auto_increment comment 'Identificador de unidad'
        primary key,
    marca         varchar(250)                       not null comment 'Marca de la unidad',
    modelo        varchar(250)                       not null comment 'Modelo de la unidad',
    placas        varchar(250)                       not null comment 'Identificador de placas de la unidad',
    serie         varchar(250)                       not null comment 'Serie identificadora de la unidad',
    ano           varchar(250)                       not null comment 'Año del modelo de la unidad',
    color         varchar(250)                       not null comment 'Color de la unidad',
    linea         varchar(250)                       not null comment 'Linea de la unidad',
    nombre_unidad varchar(250)                       not null comment 'Nombre de la unidad',
    nombre_grupo  varchar(250)                       not null comment 'Nombre del grupo de la unidad',
    created_at    datetime default CURRENT_TIMESTAMP not null comment 'Fecha de creación',
    deleted_at    datetime                           null comment 'Fecha eliminado logico'
)
    auto_increment = 50288;

