create table unit_events
(
    id           int auto_increment
        primary key,
    start_date   datetime     not null,
    end_date     datetime     not null,
    name_device  varchar(250) not null,
    imei         varchar(250) not null,
    dt_msg       varchar(250) null,
    id_msg       varchar(250) not null,
    id_msg_type  varchar(250) null,
    desc_msg     varchar(250) not null,
    lat          varchar(250) not null,
    lon          varchar(250) not null,
    ubicacion    varchar(250) not null,
    vel          varchar(250) not null,
    dtmsg        varchar(250) null,
    ignicion     varchar(250) not null,
    odometro_kms varchar(250) not null,
    dir          varchar(250) not null,
    nombre_grupo varchar(250) null,
    unit_idgps   int          not null,
    constraint unit_events_unit_id_foreign
        foreign key (unit_idgps) references units (idgps)
            on delete cascade
)
    auto_increment = 20;

